script: |
  super -f text -I q1268.spq | sort > q1268.out

inputs:
  - name: q1268.spq
    data: |
      SELECT DISTINCT + - col1 - - 50 * + - col1 * col0 * - + col0 + + + CAST ( + col2 AS INTEGER ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + CAST ( - - col1 AS INTEGER ) + - CAST ( NULL AS INTEGER ) + col2 NOT IN ( - col1 / + col2, ( + - col2 ) );
  - name: tab0

outputs:
  - name: q1268.out
    data: |
